use memo;




select * from user;
select * from schedule;
select * from follow;

-- 103 | 임시 새 회원 id
-- 회원가입

-- 회원정보 조회
select * from user where id = 103;

-- 메모 작성

-- 20 | 임시 유저 id
-- 나의 오늘 일정 리스트 조회
select * from schedule where userId = 20 and date = now() order by date asc limit 0, 25;

-- 나의 지나지 않은 일정 리스트 조회
select * from schedule where userId = 20 and date > now() order by date asc limit 0, 25;

-- 나의 지난 일정 리스트 조회
select * from schedule where userId = 20 and date < now() order by date desc limit 0, 25;

-- 팔로잉한 친구들의 오늘 일정 리스트
select s.id schedule_id, s.content, s.date, s.isDone, s.createdAt, s.updatedAt, u.nickname
from follow f
join schedule s on f.followeeId = s.userId
join user u on s.userId = u.id
where f.followerId = 20 and s.date = now()
order by s.date asc
limit 0, 25;

-- 팔로잉한 친구들의 지나지 않은 일정 리스트
select s.id schedule_id, s.content, s.date, s.isDone, s.createdAt, s.updatedAt, u.nickname
from follow f
join schedule s on f.followeeId = s.userId
join user u on s.userId = u.id
where f.followerId = 20 and s.date > now()
order by s.date asc
limit 0, 25;

-- 팔로잉한 친구들의 지난 일정 리스트
select s.id schedule_id, s.content, s.date, s.isDone, s.createdAt, s.updatedAt, u.nickname
from follow f
join schedule s on f.followeeId = s.userId
join user u on s.userId = u.id
where f.followerId = 20 and s.date < now()
order by s.date desc
limit 0, 25;

-- 완료 여부 토글 기능
update schedule
set isDone = case when isDone = 0 then 1 else 0 end
where id = 1001;
-- 또는
update schedule
set isDone = if(isDone = 0, 1, 0)
where id = 1001;

-- 확인
select * from schedule where id = 1001;